object.script:
transpTicks = 0 transpTicksLast1 = 0 transpTicksLast2 = 0 transpFreq = 0 transpPulseTable = {}
function onTick() transpActive = input.getBool(30) transpPulse = input.getBool(31) compassAngle = input.getNumber(27) mapZoom = input.getNumber(32)
myDirectionInDeg = (-compassAngle + 0.5) * 360 distanceOnScreen = mapZoom * 1000; --zoom 1 = 1000m on the largest side of the monitor
--| handle transponder if (transpActive) then transpTicks = transpTicks+1 if (transpPulse) then transpPulseTable = {1,1,1} transpTicksLast2 = transpTicksLast1 transpTicksLast1 = transpTicks transpFreq = transpTicksLast1 - transpTicksLast2 end else transpTicks, transpTicksLast1, transpTicksLast2, transpFreq = 0,0,0,0 end end
function onDraw() sw = screen.getWidth() sh = screen.getHeight() cx, cy = sw/2, sh/2
if (sh > 32) then --| header screen.setColor(0, 0, 0, 150) screen.drawRectF(0, 0, sw, 7)
--| current ship azimut screen.setColor(255,0,0) screen.drawLine(3,0,4,0) screen.drawLine(3,1,4,1) screen.drawLine(2,2,5,2) screen.setColor(255, 255, 255) screen.drawLine(2,3,5,3) screen.drawLine(3,4,4,4) screen.drawLine(3,5,4,5) screen.drawTextBox(6, 1, sw-1, 5, string.format("%.0f", myDirectionInDeg), -1, 0)
--| transponder locator if (transpActive) then if (#transpPulseTable > 0) then table.remove(transpPulseTable, 1) screen.setColor(255,0,0) screen.drawCircleF(sw-4, 3, 2) screen.setColor(150,0,0) screen.drawCircle(sw-4, 3, 2) else screen.setColor(30,30,30) screen.drawCircleF(sw-4, 3, 2) screen.setColor(0,0,0) screen.drawCircle(sw-4, 3, 2) end screen.setColor(255,255,255) screen.drawTextBox(0, 0, sw-7, 7, string.format("%.0f", transpFreq * 50 - 250).."m", 1, 0) end end
--| map size if (sw > 32) then screen.setColor(0,0,0) if (sw > sh) then screen.drawLine(sw/2-17, sh-4, sw/2-17, sh-1) screen.drawLine(sw/2+15, sh-4, sw/2+15, sh-1) screen.drawLine(sw/2-17, sh-3, sw/2+15, sh-3) halign = 0 else screen.drawLine(sw-2, sh-11, sw-5, sh-11) screen.drawLine(sw-2, sh-3, sw-5, sh-3) screen.drawLine(sw-3, sh-11, sw-3, sh-3) halign = 1 end screen.drawTextBox(5, sh-9, sw-10, 5, string.format("%.1f", distanceOnScreen / 1000).."km", halign, 0) end end
